Endophytic fungi are eukaryotic organisms, which exist in healthy plant tissues at certain stages of their lifecycles without causing any noticeable symptoms or harm to the host (
Qin et al., 2011
). The symbiotic relationship between endophytic fungi and plants provides a powerful ability to generate biologically active substances (
Ancheeva et al., 2020
), such as antibacterial (
Xu et al., 2018
; 
Yang et al., 2019
), antimalarial (
Calcul et al., 2013
), antifungal (
Wu et al., 2019
), anti-inflammatory, and anticancer agents (
Chen et al., 2020b
; 
Siridechakorn et al., 2017
).

Irpex lacteus
(Fr.) Fr. (Phanerochaetaceae)

, a basidiomycete that biodegrades and turns dead wood white (i.e., white rot), is often used as a traditional Chinese medicine for the treatment of chronic glomerulonephritis (
Liu et al., 2013
). In recent years, several undescribed furan derivatives (i.e., irpexins A-H) (
Wang et al., 2021
), sesquiterpenoids (i. e., tremutins A-H (
Wang et al., 2020
), irlactins A-K (
Ding et al., 2013
, 
2018
, 2019), and irpexolactins A-N (
Chen et al., 2020a
)), triterpenes (i. e., irpeksolactins A-J) (
Tang et al., 2019
), and polyketides (i.e., irpexins I-J) (
Wang et al., 2021
) have been isolated from their metabolite compositions, and their bioactivities were explored.

In addition to the above-mentioned isolate analyses, the absolute configurations of irpexlacte B (
3
) and C (
4
) (
Duan et al., 2019
) were confirmed to be 
S
and 
S
, respectively, based on the well-matched theoretical and experimental ECD results (
Fig. 9
). Their 1D NMR data are also shown in 
Table 2
. Along with six congeners, tremulenolide D (
2
) (
Liu et al., 2013
), 5-(3-Oxopentyl)-2-furaldehyde (
6
) (C´ardenas et al., 2011), irpexolactin I (
7
), irpexolactin J (
8
) (
Chen et al., 2020a
), 2-furoic acid (
14
) (
Ying et al., 2013
), and 5-(3-methoxy-3-oxopropyl)furan-2-carboxylic acid (
15
) (
Chen et al., 2016
) were also obtained in this study, as shown in 
Fig. 1
.
